import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the "Your Profile" link using text selector (first occurrence)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });

    // Click the first "Your Profile" link (simulate user navigation)
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    if (profileLinks.length === 0) throw new Error('No "Your Profile" link found');
    await profileLinks[0].click();

    // Wait for the profile section to load by looking for the profile image (alt="Jun Kim")
    await page.waitForSelector('img[alt="Jun Kim"]', { timeout: 5000 });

    // Take screenshot of profile section
    const step2 = path.join(screenshotsDir, 'step_2_profile.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract Jun's profile info using different selectors
    // Full name: .profile-info h2
    // Username: .profile-info .username
    // Bio: .profile-info .bio
    // Orders/Reviews/Seller Rating: .profile-stats .stat-number
    // Email: Not visible on page, so skip

    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.profile-info .username', el => el.textContent.trim());
    const bio = await page.$eval('.profile-info .bio', el => el.textContent.trim());

    // Get all stat numbers and labels
    const statNumbers = await page.$$eval('.profile-stats .stat-number', els => els.map(el => el.textContent.trim()));
    const statLabels = await page.$$eval('.profile-stats .stat-label', els => els.map(el => el.textContent.trim()));

    // Build stats object
    const stats = {};
    for (let i = 0; i < statNumbers.length; i++) {
      stats[statLabels[i] || `stat${i+1}`] = statNumbers[i];
    }

    // Get profile image src
    const profileImage = await page.$eval('.profile-image', el => el.getAttribute('src'));

    // Extract Jun's recent reviews (titles and ratings)
    const reviews = await page.$$eval('.reviews-list .review-item', nodes =>
      nodes.map(node => {
        const productTitle = node.querySelector('.review-product-title')?.textContent.trim() || '';
        const reviewTitle = node.querySelector('.review-title')?.textContent.replace(/"/g, '').trim() || '';
        const ratingStars = node.querySelector('.stars')?.textContent.trim() || '';
        const reviewDate = node.querySelector('.review-date')?.textContent.trim() || '';
        return { productTitle, reviewTitle, ratingStars, reviewDate };
      })
    );

    // Extract Jun's listed products (titles and prices)
    const junProducts = await page.$$eval('.profile-sections .section:nth-child(1) .product-card', nodes =>
      nodes.map(node => {
        const title = node.querySelector('.product-title')?.textContent.trim() || '';
        const price = node.querySelector('.product-price')?.textContent.trim() || '';
        return { title, price };
      })
    );

    // Take a screenshot of the reviews section
    const reviewsSection = await page.$('.profile-sections .section:nth-child(2)');
    if (reviewsSection) {
      const box = await reviewsSection.boundingBox();
      if (box) {
        const step3 = path.join(screenshotsDir, 'step_3_reviews.png');
        await page.screenshot({ path: step3, clip: box });
        screenshots.push(step3);
      }
    }

    // Return extracted data
    return {
      success: true,
      action: "Harvested Jun's user profile information, including name, username, bio, stats, profile image, recent reviews, and listed products",
      extractedData: {
        fullName,
        username,
        bio,
        stats,
        profileImage,
        reviews,
        junProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
